export const categories = [
    { id: 1, name:'Music & Album' , icon: < LibraryMusicSharpIcon />,type:'Music' },
    { id: 2, name:'Movie & T.V. Shows' , icon: < MovieFilterSharpIcon />,type:'Movies' },
    { id: 3, name:'Sports & Games' , icon: < SportsCricketSharpIcon />,type:'Sports' },
    { id: 4, name:'A.I. &  Tech' , icon: < SmartToySharpIcon />,type:'Tech' },
    { id: 5, name:'Fashions & Glamour' , icon: <TheaterComedySharpIcon />,type:'Fashion' },
